import React from 'react';

const ProfileIcon = ({ className, width = 30, height = 30 }) => (
  <svg 
    className={`profile-icon ${className || ''}`}
    width={width}
    height={height}
    viewBox="0 0 30 30"
    fill="none"
    xmlns="http://www.w3.org/2000/svg"
  >
    <circle cx="15" cy="15" r="14" stroke="currentColor" strokeWidth="2"/>
    <circle cx="15" cy="12" r="5" stroke="currentColor" strokeWidth="2"/>
    <path 
      d="M6 25C6 21.6863 8.68629 19 12 19H18C21.3137 19 24 21.6863 24 25" 
      stroke="currentColor" 
      strokeWidth="2"
    />
  </svg>
);

export default ProfileIcon;
